        try {
            const result = await axios.get('https://complimentr.com/api');
             const response = result.data.compliment;
            return (
                <>
                    <header>
                        <PinknavRight

                            title='Thanks User'
                        />

                    </header>

                    <main className="inner-container-left">
                        <h2>
                            Hier een mooie boodschap voor jou : {response}
                        </h2>


                    </main>
                </>

            )


        } catch (e) {
            console.error(e);
        }

    }



export default ThanksPage
